mapper.select:

select 

from DTHKTXN
where DTHKTXN_TX_DATE = #{dthktxnTxDate,jdbcType=VARCHAR}
  and DTHKTXN_EJFNO = #{dthktxnEjfno,jdbcType=INTEGER}

mapper.delete:

